import React, { Component }  from 'react'
import { get } from "lodash";
import { connect } from "react-redux";
import {
  CCard,
  CCardBody,
  CCardHeader,
  CCol,
  CDataTable,
  CButton,
  CRow,
} from '@coreui/react'
import OrderDetail from './OrderDetail'
import OrderActions from "../../redux/actions/order";

const fields = ['Date of create', 'Phone','Payment Status','Bill Status','Payment Method','Total',{ key: 'actions', _style: { width: '15%'} }]

class OrderList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      large: false,
    }
  }
  componentDidMount() {
    const { onClearState, onGetList } = this.props;
    onClearState();
    onGetList();
  }

  setLarge = (large) => {
    this.setState({
      large
    })
  }

  onDetail = (large, item) =>{
    const { onGetDetail } = this.props;
    this.setState({
      large
    })
    if(item){onGetDetail(item)}
    //onGetDetail(item)
  }

  onClose = (large) =>{
    const { onClearDetail } = this.props;
    this.setState({
      large
    })
    onClearDetail();
  }

  render () {
    const {large} = this.state;
    const {listOrder, orderDetail, onClearDetail} = this.props;
    return (
      <>
        <CRow>
          <CCol>
            <CCard>
              <CCardHeader>
                <h5 className="float-left my-2">Danh sách đơn hàng</h5>
              </CCardHeader>

              <CCardBody>
                <CDataTable
                  items={listOrder}
                  fields={fields}
                  hover
                  striped
                  bordered
                  itemsPerPage={10}
                  pagination
                  scopedSlots = {{
                    'Date of create': (item) => (
                      <td>{item.createdAt}</td>
                    ),
                    'Phone': (item) => (
                      <td>{item.shipping_phonenumber}</td>
                    ),
                    'Payment Method': (item) => (
                      <td>{item.payment_method=== "local" ? '(COD) Tiền mặt' : 'Paypal'}</td>
                    ),
                    'Payment Status': (item) => (
                      <td>{item.is_paid== true ? 'Đã thanh toán' : 'Chưa thanh toán'}</td>
                    ),
                    'Bill Status': (item) => (
                      <td>{item.status== true ? 'Đã giao hàng' : 'Chưa giao hàng'}</td>
                    ),
                    'Total': (item) => (
                      <td>{item.total_price}</td>
                    ),
                    'actions':
                    (item)=>(
                      <td>
                        <CButton
                          onClick={() => this.onDetail(!large, item._id)}
                          className="mr-1 mb-1 mb-xl-0"
                          color="warning"
                        >
                          Sửa
                        </CButton>
                        <CButton
                          onClick={() => this.setLarge(!large)}
                          className="mr-1"
                          color="danger"
                        >
                          Xóa
                        </CButton>
                      </td>)
                  }}
                />
                {(orderDetail && large) && <OrderDetail large={large} order={orderDetail} onClose={this.onClose} onClearDetail={onClearDetail}
                onSubmit={this.onSubmit}/>}

                {(!orderDetail && large) && <OrderDetail large={large} order={orderDetail} onClose={this.onClose} onClearDetail={onClearDetail}
                onSubmit={this.onSubmit}/>}
              </CCardBody>
            </CCard>
          </CCol>
        </CRow>
      </>
    )
  }
}

const mapStateToProps = (state) => {
  return {
    listOrder: state.order.list,
    orderDetail: state.order.detail,
  }
}

const mapDispatchToProps = (dispatch) => {
  return {
    onGetList: () => {
      dispatch(OrderActions.onGetList())
    },
    onClearState: () =>{
      dispatch(OrderActions.onClearState())
    },
    onClearDetail: () =>{
      dispatch(OrderActions.onClearDetail())
    },
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(OrderList)
